@matthewegould @spencecoin @ensdomains @ENS_DAO @futurealisha Matt, while I understand you may not be participating, it's like you have no idea how decentralized processes work.
Our feelings don't control the votes users have, or had delegated. 
If one is building a Web3 company, then those are based on consensus &amp; community, as $ENS is.

@matthewegould Ridiculous. I do not condone war or bigotry.
I stand for the rights of everyone;
I do get to not pick or choose.
I will vote to remove Brantly if anyone had shown *any proof* that Brantly had discriminated against them.
We are not the thought police, who close bank accounts, etc.
